import UploadFiles from './components/UploadFiles';
function App() {

    return (
        <div className="container-fluid no-gutters">
            <div className="row">
                <div className="col-9">
                </div>
                <div className="col-3">
                    <div className="wrapper-song">
                        <ul className="list-song">

                        </ul>
                    </div>
                </div>
            </div>
            <UploadFiles />
        </div>
    );
}

export default App;
